import Axious from "../../node_modules/axios";

function rand() {
  return Math.random();
}

Plotly.newPlot("myDiv", [
  {
    y: [1, 2, 3].map(rand),
    mode: "lines",
    line: { color: "#80CAF6" },
  },
]);

function graphic() {
  var cnt = 0;

  var interval = setInterval(function () {
    Plotly.extendTraces(
      "myDiv",
      {
        y: [[rand()]],
      },
      [0]
    );

    if (++cnt === 100) clearInterval(interval);
  }, 300);
}

export default graphic;
